pragma solidity ^0.4.2;
library SafeMath {

  /**
  * @dev Multiplies two numbers, throws on overflow.
  */
  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    if (a == 0) {
      return 0;
    }
    uint256 c = a * b;
    assert(c / a == b);
    return c;
  }

  /**
  * @dev Integer division of two numbers, truncating the quotient.
  */
  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    // assert(b > 0); // Solidity automatically throws when dividing by 0
    uint256 c = a / b;
    // assert(a == b * c + a % b); // There is no case in which this doesn't hold
    return c;
  }

  /**
  * @dev Substracts two numbers, throws on overflow (i.e. if subtrahend is greater than minuend).
  */
  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    assert(b <= a);
    return a - b;
  }
}

contract paperstone {

using SafeMath for uint256;

uint public money=0;
uint constant miner=0.1 ether;
uint public round=0;
address better;
uint computer;
constructor()public payable{}


mapping(uint => address)public player;
mapping(uint => uint)public item;
mapping(uint => string)public result;

//若頭
modifier betcheck(){
    if(player[round]!=0){
        require(player[round]==msg.sender);    
    }
    _;
}


function bet() public payable betcheck{
    require(msg.value==miner);
    money = money + miner;
    player[round]=msg.sender;

}



function play(uint choose)public betcheck{
    require(money>0);
    item[round]=choose;//1為剪刀，2為石頭，3為布
    computer=block.timestamp %3+1;
    if(choose==computer)
        {
            result[round]="DRAW";
            msg.sender.transfer(money);
        }
    else if(choose<computer||(computer==1&&choose==2)){
        result[round]="LOSE";
    }
    else{
        result[round]="WIN";
        msg.sender.transfer(money*2);
    }
    round++;
    money=0;
}

}

